import { Link } from 'react-router-dom';

const SavedPropertiesPreview = ({ properties }) => {
  if (properties.length === 0) {
    return (
      <div className="no-saved-properties">
        <p>You haven't saved any properties yet</p>
        <Link to="/properties" className="browse-link">
          Browse Properties
        </Link>
      </div>
    );
  }

  return (
    <div className="saved-properties-preview">
      {properties.slice(0, 4).map(property => (
        <Link 
          key={property._id} 
          to={`/properties/${property._id}`}
          className="property-card"
        >
          <img 
            src={`/uploads/${property.images[0]}`} 
            alt={property.title} 
            className="property-image"
          />
          <div className="property-info">
            <h3>{property.title}</h3>
            <p className="price">${property.price}/month</p>
          </div>
        </Link>
      ))}
    </div>
  );
};

export default SavedPropertiesPreview;
